import React from 'react';
import { LoaderContainer, Paw, StyledSvg } from './Loader.styled';

const PawIcon = () => {
  return (
    <StyledSvg viewBox="0 0 249 209.32" width="249" height="209.32">
      <symbol id="paw" viewBox="0 0 249 209.32">
        <ellipse
          cx="27.917"
          cy="106.333"
          strokeWidth="0"
          rx="27.917"
          ry="35.833"
        />
        <ellipse
          cx="84.75"
          cy="47.749"
          strokeWidth="0"
          rx="34.75"
          ry="47.751"
        />
        <ellipse cx="162" cy="47.749" strokeWidth="0" rx="34.75" ry="47.751" />
        <ellipse
          cx="221.083"
          cy="106.333"
          strokeWidth="0"
          rx="27.917"
          ry="35.833"
        />
        <path
          strokeWidth="0"
          d="M43.98 165.39s9.76-63.072 76.838-64.574c0 0 71.082-6.758 83.096 70.33 0 0 2.586 19.855-12.54 31.855 0 0-15.75 17.75-43.75-6.25 0 0-7.124-8.374-24.624-7.874 0 0-12.75-.125-21.5 6.625 0 0-16.375 18.376-37.75 12.75 0 0-28.29-7.72-19.77-42.86z"
        />
      </symbol>

      <use xlinkHref="#paw" />
    </StyledSvg>
  );
};

const Loader = () => {
  return (
    <>
      <LoaderContainer>
        {[...Array(6)].map((_, i) => (
          <Paw key={i}>
            <PawIcon />
          </Paw>
        ))}
      </LoaderContainer>
    </>
  );
};

export default Loader;
